import React from 'react';
import styled from 'styled-components';

const HeaderContainer = styled.header`
  background: #b15a00;
  padding: 20px;
  text-align: center;
`;

const Logo = styled.img`
  max-width: 150px;
`;

const Header = () => {
  return (
    <HeaderContainer>
      <Logo src="/path-to-your-logo.png" alt="Pousada Pinheira" />
    </HeaderContainer>
  );
};

export default Header;
